/**********************************************************************************
Author: AEM Corp
Date:	2/20/2023
Description: Migrates Title III EL Oct Data from Staging to RDS.FactK12StudentCounts

NOTE: This Stored Procedure processes files: 116, 141
***********************************************************************************/
CREATE PROCEDURE [Staging].[Staging-to-FactK12StudentCounts_TitleIIIELOct]
	@SchoolYear SMALLINT
AS

BEGIN
	-- SET NOCOUNT ON added to prevent extra result sets from interfering with SELECT statements.
	SET NOCOUNT ON;

	-- Drop temp tables.  This allows for running the procedure as a script while debugging
		IF OBJECT_ID(N'tempdb..#vwEnglishLearnerStatuses') IS NOT NULL DROP TABLE #vwEnglishLearnerStatuses
		IF OBJECT_ID(N'tempdb..#vwLanguages') IS NOT NULL DROP TABLE #vwLanguages
		IF OBJECT_ID(N'tempdb..#vwGradeLevels') IS NOT NULL DROP TABLE #vwGradeLevels

	BEGIN TRY

		DECLARE 
		@FactTypeId INT,
		@SchoolYearId INT,
		@SYStartDate DATE,
		@SYEndDate DATE,
		@ReportingDate DATE
		
		SELECT @SchoolYearId = DimSchoolYearId 
		FROM RDS.DimSchoolYears
		WHERE SchoolYear = @SchoolYear

		SET @SYStartDate = staging.GetFiscalYearStartDate(@SchoolYear)
		SET @SYEndDate = staging.GetFiscalYearEndDate(@SchoolYear)

		--Reporting Date is the closest school day to Oct 1 according to the file spec
		DECLARE @testDate datetime
		SELECT @testDate = CAST(CAST(@SchoolYear - 1 AS CHAR(4)) + '-' + '10-01' AS DATE)
		
		SELECT @ReportingDate = 
			CASE DATEPART(DW, @testDate)
				WHEN 1 THEN (SELECT DATEADD(day, 1, @testDate))
				WHEN 7 THEN (SELECT DATEADD(day, -1, @testDate))
				ELSE @testDate
			END	


	--Create the temp tables (and any relevant indexes) needed for this domain
		SELECT *
		INTO #vwGradeLevels
		FROM RDS.vwDimGradeLevels
		WHERE SchoolYear = @SchoolYear

		CREATE CLUSTERED INDEX ix_tempvwGradeLevels 
			ON #vwGradeLevels (GradeLevelTypeDescription, GradeLevelMap);

		SELECT *
		INTO #vwEnglishLearnerStatuses
		FROM RDS.vwDimEnglishLearnerStatuses
		WHERE SchoolYear = @SchoolYear

		CREATE CLUSTERED INDEX ix_tempvwEnglishLearnerStatuses
			ON #vwEnglishLearnerStatuses (EnglishLearnerStatusCode, PerkinsEnglishLearnerStatusCode, TitleIIIAccountabilityProgressStatusCode, TitleIIILanguageInstructionProgramTypeCode);

		SELECT *
		INTO #vwLanguages
		FROM RDS.vwDimLanguages
		WHERE SchoolYear = @SchoolYear

		CREATE CLUSTERED INDEX ix_tempvwLanguages
			ON #vwLanguages (Iso6392LanguageCode);

		--Set the correct Fact Type
		SELECT @FactTypeId = DimFactTypeId 
		FROM rds.DimFactTypes
		WHERE FactTypeCode = 'TitleIIIELSY' -- DimFactTypeId = 10

		--Clear the Fact table of the data about to be migrated  
		DELETE RDS.FactK12StudentCounts
		WHERE SchoolYearId = @SchoolYearId 
			AND FactTypeId = @FactTypeId

		IF OBJECT_ID('tempdb..#Facts') IS NOT NULL 
			DROP TABLE #Facts
		
		--Create and load #Facts temp table
		CREATE TABLE #Facts (
			StagingId								int not null
			, SchoolYearId							int null
			, FactTypeId							int null
			, GradeLevelId							int null
			, AgeId									int null
			, RaceId								int null
			, K12DemographicId						int null
			, StudentCount							int null
			, SEAId									int null
			, IEUId									int null
			, LEAId									int null
			, K12SchoolId							int null
			, K12StudentId							int null
			, IdeaStatusId							int null
			, DisabilityStatusId					int null
			, LanguageId							int null
			, MigrantStatusId						int null
			, TitleIStatusId						int null
			, TitleIIIStatusId						int null
			, AttendanceId							int null
			, CohortStatusId						int null
			, NOrDStatusId							int null
			, CTEStatusId							int null
			, K12EnrollmentStatusId					int null
			, EnglishLearnerStatusId				int null
			, HomelessnessStatusId					int null
			, EconomicallyDisadvantagedStatusId		int null
			, FosterCareStatusId					int null
			, ImmigrantStatusId						int null
			, PrimaryDisabilityTypeId				int null
			, SpecialEducationServicesExitDateId	int null
			, MigrantStudentQualifyingArrivalDateId	int null
			, LastQualifyingMoveDateId				int null
		)

		INSERT INTO #Facts
		SELECT DISTINCT
			ske.id										StagingId							
			, rsy.DimSchoolYearId						SchoolYearId
			, @FactTypeId								FactTypeId							
			, ISNULL(rgls.DimGradeLevelId, -1)			GradeLevelId							
			, -1										AgeId									
			, ISNULL(rdr.DimRaceId, -1)					RaceId								
			, ISNULL(rdkd.DimK12DemographicId, -1)		K12DemographicId						
			, 1											StudentCount							
			, ISNULL(rds.DimSeaId, -1)					SEAId									
			, -1										IEUId									
			, ISNULL(rdl.DimLeaID, -1)					LEAId									
			, ISNULL(rdksch.DimK12SchoolId, -1)			K12SchoolId							
			, ISNULL(rdp.DimPeopleId, -1)				K12StudentId							
			, -1										IdeaStatusId							
			, -1										DisabilityStatusId							
			, ISNULL(rdvl.DimLanguageId, -1)			LanguageId							
			, -1										MigrantStatusId						
			, -1										TitleIStatusId						
			, -1										TitleIIIStatusId						
			, -1										AttendanceId							
			, -1										CohortStatusId						
			, -1 										NOrDStatusId							
			, -1										CTEStatusId							
			, -1										K12EnrollmentStatusId					
			, -1										EnglishLearnerStatusId				
			, -1										HomelessnessStatusId					
			, -1										EconomicallyDisadvantagedStatusId		
			, -1										FosterCareStatusId					
			, -1										ImmigrantStatusId						
			, -1										PrimaryDisabilityTypeId				
			, -1										SpecialEducationServicesExitDateId	
			, -1										MigrantStudentQualifyingArrivalDateId	
			, -1										LastQualifyingMoveDateId				
			
		FROM Staging.K12Enrollment ske
	--english learner
		JOIN Staging.PersonStatus el 
			ON ske.StudentIdentifierState = el.StudentIdentifierState
			AND ISNULL(ske.LeaIdentifierSeaAccountability, '') = ISNULL(el.LeaIdentifierSeaAccountability, '') 
			AND ISNULL(ske.SchoolIdentifierSea, '') = ISNULL(el.SchoolIdentifierSea, '')
			AND el.EnglishLearner_StatusStartDate <= @ReportingDate
			AND ISNULL(el.EnglishLearner_StatusEndDate, @SYEndDate) >= @ReportingDate
		JOIN RDS.DimSchoolYears rsy
			ON ske.SchoolYear = rsy.SchoolYear
		LEFT JOIN RDS.DimLeas rdl
			ON ske.LeaIdentifierSeaAccountability = rdl.LeaIdentifierSea
			AND rdl.RecordStartDateTime <= @ReportingDate
			AND ISNULL(rdl.RecordEndDateTime, @SYEndDate) >= @ReportingDate
		LEFT JOIN RDS.DimK12Schools rdksch
			ON ske.SchoolIdentifierSea = rdksch.SchoolIdentifierSea
			AND rdksch.RecordStartDateTime  <= @ReportingDate
			AND ISNULL(rdksch.RecordEndDateTime, @SYEndDate) >= @ReportingDate
		JOIN RDS.DimSeas rds
			ON convert(date, rds.RecordStartDateTime)  <= @ReportingDate
			AND ISNULL(convert(date, rds.RecordEndDateTime), @SYEndDate) >= @ReportingDate
	--race	
		LEFT JOIN RDS.vwUnduplicatedRaceMap spr 
			ON ske.SchoolYear = spr.SchoolYear
			AND ske.StudentIdentifierState = spr.StudentIdentifierState
			AND (ske.SchoolIdentifierSea = spr.SchoolIdentifierSea
				OR ske.LEAIdentifierSeaAccountability = spr.LeaIdentifierSeaAccountability)
	--demographics
		LEFT JOIN rds.vwDimK12Demographics rdkd
			ON rsy.SchoolYear = rdkd.SchoolYear
			AND ISNULL(ske.Sex, 'MISSING') = ISNULL(rdkd.SexMap, rdkd.SexCode)
	--english learner (RDS)
		LEFT JOIN #vwDimEnglishLearnerStatuses rdels
			ON ISNULL(CAST(el.EnglishLearnerStatus AS SMALLINT), -1) = ISNULL(CAST(rdels.EnglishLearnerStatusMap AS SMALLINT), -1)
			AND PerkinsEnglishLearnerStatusCode = 'MISSING'
	--languages (RDS)
		LEFT JOIN #vwLanguages rdvl
			ON ISNULL(immigrant.ISO_639_2_NativeLanguage, 'MISSING') = ISNULL(rdvl.Iso6392LanguageMap, 'MISSING')
	--grade (RDS)
		LEFT JOIN #vwGradeLevels rgls
			ON ske.GradeLevel = rgls.GradeLevelMap
			AND rgls.GradeLevelTypeDescription = 'Entry Grade Level'
	--race (RDS)	
		LEFT JOIN #vwRaces rdr
			ON ISNULL(rdr.RaceMap, rdr.RaceCode) =
				CASE
					when ske.HispanicLatinoEthnicity = 1 then 'HispanicorLatinoEthnicity'
					WHEN spr.RaceMap IS NOT NULL THEN spr.RaceMap
					ELSE 'Missing'
				END
		JOIN RDS.DimPeople rdp
			ON ske.StudentIdentifierState = rdp.StateStudentIdentifier
			AND rdp.IsActiveK12Student = 1
			AND ISNULL(ske.FirstName, '') = ISNULL(rdp.FirstName, '')
			AND ISNULL(ske.MiddleName, '') = ISNULL(rdp.MiddleName, '')
			AND ISNULL(ske.LastOrSurname, 'MISSING') = ISNULL(rdp.LastOrSurname, 'MISSING')
			AND ISNULL(ske.Birthdate, '1/1/1900') = ISNULL(rdp.BirthDate, '1/1/1900')
			AND rdp.RecordStartDateTime  <= @ReportingDate
			AND ISNULL(rdp.RecordEndDateTime, @SYEndDate) >= @ReportingDate
		WHERE ske.EnrollmentEntryDate  <= @ReportingDate
		AND ISNULL(ske.EnrollmentExitDate, @SYEndDate) >= @ReportingDate

		--Final insert into RDS.FactK12StudentCounts table 
		INSERT INTO RDS.FactK12StudentCounts (
			[SchoolYearId]
			, [FactTypeId]
			, [GradeLevelId]
			, [AgeId]
			, [RaceId]
			, [K12DemographicId]
			, [StudentCount]
			, [SEAId]
			, [IEUId]
			, [LEAId]
			, [K12SchoolId]
			, [K12StudentId]
			, [IdeaStatusId]
			, [DisabilityStatusId]
			, [LanguageId]
			, [MigrantStatusId]
			, [TitleIStatusId]
			, [TitleIIIStatusId]
			, [AttendanceId]
			, [CohortStatusId]
			, [NOrDStatusId]
			, [CTEStatusId]
			, [K12EnrollmentStatusId]
			, [EnglishLearnerStatusId]
			, [HomelessnessStatusId]
			, [EconomicallyDisadvantagedStatusId]
			, [FosterCareStatusId]
			, [ImmigrantStatusId]
			, [PrimaryDisabilityTypeId]
			, [SpecialEducationServicesExitDateId]
			, [MigrantStudentQualifyingArrivalDateId]
			, [LastQualifyingMoveDateId]
		)
		SELECT
			[SchoolYearId]
			, [FactTypeId]
			, [GradeLevelId]
			, [AgeId]
			, [RaceId]
			, [K12DemographicId]
			, [StudentCount]
			, [SEAId]
			, [IEUId]
			, [LEAId]
			, [K12SchoolId]
			, [K12StudentId]
			, [IdeaStatusId]
			, [DisabilityStatusId]
			, [LanguageId]
			, [MigrantStatusId]
			, [TitleIStatusId]
			, [TitleIIIStatusId]
			, [AttendanceId]
			, [CohortStatusId]
			, [NOrDStatusId]
			, [CTEStatusId]
			, [K12EnrollmentStatusId]
			, [EnglishLearnerStatusId]
			, [HomelessnessStatusId]
			, [EconomicallyDisadvantagedStatusId]
			, [FosterCareStatusId]
			, [ImmigrantStatusId]
			, [PrimaryDisabilityTypeId]
			, [SpecialEducationServicesExitDateId]
			, [MigrantStudentQualifyingArrivalDateId]
			, [LastQualifyingMoveDateId]
		FROM #Facts

		ALTER INDEX ALL ON RDS.FactK12StudentCounts REBUILD

	END TRY
	BEGIN CATCH
		INSERT INTO Staging.ValidationErrors VALUES ('Staging.Staging-to-FactK12StudentCounts_TitleIIIELOct', 'RDS.FactK12StudentCounts', 'FactK12StudentCounts', 'FactK12StudentCounts', ERROR_MESSAGE(), 1, NULL, GETDATE())
	END CATCH

END
GO
/****** Object:  StoredProcedure [Staging].[Staging-to-FactK12StudentCounts_TitleIIIELSY]    Script Date: 8/9/2023 3:43:40 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
/**********************************************************************************
Author: AEM Corp
Date:	2/20/2023
Description: Migrates Title III EL SY Data from Staging to RDS.FactK12StudentCounts

NOTE: This Stored Procedure processes files: 045, 204
***********************************************************************************/
CREATE PROCEDURE [Staging].[Staging-to-FactK12StudentCounts_TitleIIIELSY]
	@SchoolYear SMALLINT
AS

BEGIN
	-- SET NOCOUNT ON added to prevent extra result sets from interfering with SELECT statements.
	SET NOCOUNT ON;

	-- Drop temp tables.  This allows for running the procedure as a script while debugging
		IF OBJECT_ID(N'tempdb..#vwEnglishLearnerStatuses') IS NOT NULL DROP TABLE #vwEnglishLearnerStatuses
		IF OBJECT_ID(N'tempdb..#vwLanguages') IS NOT NULL DROP TABLE #vwLanguages
		IF OBJECT_ID(N'tempdb..#vwGradeLevels') IS NOT NULL DROP TABLE #vwGradeLevels

	BEGIN TRY

		DECLARE 
		@FactTypeId INT,
		@SchoolYearId INT,
		@SYStartDate DATE,
		@SYEndDate DATE
		
		SELECT @SchoolYearId = DimSchoolYearId 
		FROM RDS.DimSchoolYears
		WHERE SchoolYear = @SchoolYear

		SET @SYStartDate = staging.GetFiscalYearStartDate(@SchoolYear)
		SET @SYEndDate = staging.GetFiscalYearEndDate(@SchoolYear)

	--Create the temp tables (and any relevant indexes) needed for this domain
		SELECT *
		INTO #vwGradeLevels
		FROM RDS.vwDimGradeLevels
		WHERE SchoolYear = @SchoolYear

		CREATE CLUSTERED INDEX ix_tempvwGradeLevels 
			ON #vwGradeLevels (GradeLevelTypeDescription, GradeLevelMap);

		SELECT *
		INTO #vwEnglishLearnerStatuses
		FROM RDS.vwDimEnglishLearnerStatuses
		WHERE SchoolYear = @SchoolYear

		CREATE CLUSTERED INDEX ix_tempvwEnglishLearnerStatuses
			ON #vwEnglishLearnerStatuses (EnglishLearnerStatusCode, PerkinsEnglishLearnerStatusCode, TitleIIIAccountabilityProgressStatusCode, TitleIIILanguageInstructionProgramTypeCode);

		SELECT *
		INTO #vwLanguages
		FROM RDS.vwDimLanguages
		WHERE SchoolYear = @SchoolYear

		CREATE CLUSTERED INDEX ix_tempvwLanguages
			ON #vwLanguages (Iso6392LanguageCode);

		--Set the correct Fact Type
		SELECT @FactTypeId = DimFactTypeId 
		FROM rds.DimFactTypes
		WHERE FactTypeCode = 'TitleIIIELSY' -- DimFactTypeId = 10

		--Clear the Fact table of the data about to be migrated  
		DELETE RDS.FactK12StudentCounts
		WHERE SchoolYearId = @SchoolYearId 
			AND FactTypeId = @FactTypeId

		IF OBJECT_ID('tempdb..#Facts') IS NOT NULL 
			DROP TABLE #Facts
		
		--Create and load #Facts temp table
		CREATE TABLE #Facts (
			StagingId								int not null
			, SchoolYearId							int null
			, FactTypeId							int null
			, GradeLevelId							int null
			, AgeId									int null
			, RaceId								int null
			, K12DemographicId						int null
			, StudentCount							int null
			, SEAId									int null
			, IEUId									int null
			, LEAId									int null
			, K12SchoolId							int null
			, K12StudentId							int null
			, IdeaStatusId							int null
			, DisabilityStatusId					int null
			, LanguageId							int null
			, MigrantStatusId						int null
			, TitleIStatusId						int null
			, TitleIIIStatusId						int null
			, AttendanceId							int null
			, CohortStatusId						int null
			, NOrDStatusId							int null
			, CTEStatusId							int null
			, K12EnrollmentStatusId					int null
			, EnglishLearnerStatusId				int null
			, HomelessnessStatusId					int null
			, EconomicallyDisadvantagedStatusId		int null
			, FosterCareStatusId					int null
			, ImmigrantStatusId						int null
			, PrimaryDisabilityTypeId				int null
			, SpecialEducationServicesExitDateId	int null
			, MigrantStudentQualifyingArrivalDateId	int null
			, LastQualifyingMoveDateId				int null
		)

		INSERT INTO #Facts
		SELECT DISTINCT
			ske.id										StagingId							
			, rsy.DimSchoolYearId						SchoolYearId
			, @FactTypeId								FactTypeId							
			, ISNULL(rgls.DimGradeLevelId, -1)			GradeLevelId							
			, ISNULL(rda.DimAgeId, -1)					AgeId									
			, -1										RaceId								
			, ISNULL(rdkd.DimK12DemographicId, -1)		K12DemographicId						
			, 1											StudentCount							
			, ISNULL(rds.DimSeaId, -1)					SEAId									
			, -1										IEUId									
			, ISNULL(rdl.DimLeaID, -1)					LEAId									
			, ISNULL(rdksch.DimK12SchoolId, -1)			K12SchoolId							
			, ISNULL(rdp.DimPeopleId, -1)				K12StudentId							
			, -1										IdeaStatusId							
			, -1										DisabilityStatusId							
			, ISNULL(rdvl.DimLanguageId, -1)			LanguageId							
			, -1										MigrantStatusId						
			, -1										TitleIStatusId						
			, ISNULL(rd3ts.DimTitleIIIStatusId, -1)		TitleIIIStatusId						
			, -1										AttendanceId							
			, -1										CohortStatusId						
			, -1 										NOrDStatusId							
			, -1										CTEStatusId							
			, -1										K12EnrollmentStatusId					
			, -1										EnglishLearnerStatusId				
			, -1										HomelessnessStatusId					
			, -1										EconomicallyDisadvantagedStatusId		
			, -1										FosterCareStatusId					
			, -1										ImmigrantStatusId						
			, -1										PrimaryDisabilityTypeId				
			, -1										SpecialEducationServicesExitDateId	
			, -1										MigrantStudentQualifyingArrivalDateId	
			, -1										LastQualifyingMoveDateId				
			
		FROM Staging.K12Enrollment ske
	--english learner
		JOIN Staging.PersonStatus el 
			ON ske.StudentIdentifierState = el.StudentIdentifierState
			AND ISNULL(ske.LeaIdentifierSeaAccountability, '') = ISNULL(el.LeaIdentifierSeaAccountability, '') 
			AND ISNULL(ske.SchoolIdentifierSea, '') = ISNULL(el.SchoolIdentifierSea, '')
			AND el.EnglishLearner_StatusStartDate >= @SYStartDate
			AND ISNULL(el.EnglishLearner_StatusEndDate, @SYEndDate) <= @SYEndDate
		JOIN RDS.DimSchoolYears rsy
			ON ske.SchoolYear = rsy.SchoolYear
		LEFT JOIN RDS.DimLeas rdl
			ON ske.LeaIdentifierSeaAccountability = rdl.LeaIdentifierSea
			AND el.EnglishLearner_StatusStartDate >= rdl.RecordStartDateTime 
			AND el.EnglishLearner_StatusStartDate <= ISNULL(rdl.RecordEndDateTime, GETDATE())
		LEFT JOIN RDS.DimK12Schools rdksch
			ON ske.SchoolIdentifierSea = rdksch.SchoolIdentifierSea
			AND el.EnglishLearner_StatusStartDate >= rdksch.RecordStartDateTime 
			AND el.EnglishLearner_StatusStartDate <= ISNULL(rdksch.RecordEndDateTime, GETDATE())
		JOIN RDS.DimSeas rds
			ON el.EnglishLearner_StatusStartDate >= convert(date, rds.RecordStartDateTime)
			AND el.EnglishLearner_StatusStartDate <= ISNULL(convert(date, rds.RecordEndDateTime), GETDATE())
	--title 3 program
		LEFT JOIN Staging.ProgramParticipationTitleIII ppt3
			ON ske.StudentIdentifierState = ppt3.StudentIdentifierState
			AND ISNULL(ske.LeaIdentifierSeaAccountability, '') = ISNULL(ppt3.LeaIdentifierSeaAccountability, '') 
			AND ISNULL(ske.SchoolIdentifierSea, '') = ISNULL(ppt3.SchoolIdentifierSea, '')
			AND ppt3.ProgramParticipationBeginDate >= el.EnglishLearner_StatusStartDate 
			AND ppt3.ProgramParticipationEndDate <= ISNULL(el.EnglishLearner_StatusEndDate, GETDATE())
	--sex (RDS)
		LEFT JOIN rds.vwDimK12Demographics rdkd
			ON rsy.SchoolYear = rdkd.SchoolYear
			AND ISNULL(ske.Sex, 'MISSING') = ISNULL(rdkd.SexMap, rdkd.SexCode)
	--english learner (RDS)	
		LEFT JOIN #vwDimEnglishLearnerStatuses rdels
			ON rsy.SchoolYear = rdels.SchoolYear
			AND ISNULL(CAST(el.EnglishLearnerStatus AS SMALLINT), -1) = ISNULL(rdels.EnglishLearnerStatusMap, -1)
			AND PerkinsEnglishLearnerStatusCode = 'MISSING'
	--title 3 (RDS)	
		LEFT JOIN rds.vwDimTitleIIIStatuses rdt3s
			ON rsy.SchoolYear = rdt3s.SchoolYear
			AND ISNULL(ppt3.EnglishLearnerParticipation, 'MISSING') = ISNULL(rdt3s.ProgramParticipationTitleIIIMap, rdt3s.ProgramParticipationTitleIIICode)
			AND ISNULL(ppt3.Proficiency_TitleIII, 'MISSING') = ISNULL(rdt3s.ProficiencyStatusMap, rdt3s.ProficiencyStatusCode)
			AND rdt3s.FormerEnglishLearnerYearStatusCode = 'MISSING'
	--languages (RDS)
		LEFT JOIN #vwLanguages rdvl
			ON ISNULL(immigrant.ISO_639_2_NativeLanguage, 'MISSING') = ISNULL(rdvl.Iso6392LanguageMap, 'MISSING')
		JOIN RDS.DimAges rda
			ON RDS.Get_Age(ske.Birthdate, immigrant.Immigrant_ProgramParticipationStartDate) = rda.AgeValue
	--grade (RDS)
		LEFT JOIN #vwGradeLevels rgls
			ON ske.GradeLevel = rgls.GradeLevelMap
			AND rgls.GradeLevelTypeDescription = 'Entry Grade Level'
		JOIN RDS.DimPeople rdp
			ON ske.StudentIdentifierState = rdp.StateStudentIdentifier
			AND rdp.IsActiveK12Student = 1
			AND ISNULL(ske.FirstName, '') = ISNULL(rdp.FirstName, '')
			AND ISNULL(ske.MiddleName, '') = ISNULL(rdp.MiddleName, '')
			AND ISNULL(ske.LastOrSurname, 'MISSING') = ISNULL(rdp.LastOrSurname, 'MISSING')
			AND ISNULL(ske.Birthdate, '1/1/1900') = ISNULL(rdp.BirthDate, '1/1/1900')
			AND el.EnglishLearner_StatusStartDate >= rdp.RecordStartDateTime 
			AND el.EnglishLearner_StatusStartDate <= ISNULL(rdp.RecordEndDateTime, GETDATE())
		WHERE el.EnglishLearner_StatusStartDate >= ske.EnrollmentEntryDate 
		AND el.EnglishLearner_StatusStartDate <= ISNULL(ske.EnrollmentExitDate, GETDATE())

		--Final insert into RDS.FactK12StudentCounts table 
		INSERT INTO RDS.FactK12StudentCounts (
			[SchoolYearId]
			, [FactTypeId]
			, [GradeLevelId]
			, [AgeId]
			, [RaceId]
			, [K12DemographicId]
			, [StudentCount]
			, [SEAId]
			, [IEUId]
			, [LEAId]
			, [K12SchoolId]
			, [K12StudentId]
			, [IdeaStatusId]
			, [DisabilityStatusId]
			, [LanguageId]
			, [MigrantStatusId]
			, [TitleIStatusId]
			, [TitleIIIStatusId]
			, [AttendanceId]
			, [CohortStatusId]
			, [NOrDStatusId]
			, [CTEStatusId]
			, [K12EnrollmentStatusId]
			, [EnglishLearnerStatusId]
			, [HomelessnessStatusId]
			, [EconomicallyDisadvantagedStatusId]
			, [FosterCareStatusId]
			, [ImmigrantStatusId]
			, [PrimaryDisabilityTypeId]
			, [SpecialEducationServicesExitDateId]
			, [MigrantStudentQualifyingArrivalDateId]
			, [LastQualifyingMoveDateId]
		)
		SELECT
			[SchoolYearId]
			, [FactTypeId]
			, [GradeLevelId]
			, [AgeId]
			, [RaceId]
			, [K12DemographicId]
			, [StudentCount]
			, [SEAId]
			, [IEUId]
			, [LEAId]
			, [K12SchoolId]
			, [K12StudentId]
			, [IdeaStatusId]
			, [DisabilityStatusId]
			, [LanguageId]
			, [MigrantStatusId]
			, [TitleIStatusId]
			, [TitleIIIStatusId]
			, [AttendanceId]
			, [CohortStatusId]
			, [NOrDStatusId]
			, [CTEStatusId]
			, [K12EnrollmentStatusId]
			, [EnglishLearnerStatusId]
			, [HomelessnessStatusId]
			, [EconomicallyDisadvantagedStatusId]
			, [FosterCareStatusId]
			, [ImmigrantStatusId]
			, [PrimaryDisabilityTypeId]
			, [SpecialEducationServicesExitDateId]
			, [MigrantStudentQualifyingArrivalDateId]
			, [LastQualifyingMoveDateId]
		FROM #Facts

		ALTER INDEX ALL ON RDS.FactK12StudentCounts REBUILD

	END TRY
	BEGIN CATCH
		INSERT INTO Staging.ValidationErrors VALUES ('Staging.Staging-to-FactK12StudentCounts_TitleIIIELSY', 'RDS.FactK12StudentCounts', 'FactK12StudentCounts', 'FactK12StudentCounts', ERROR_MESSAGE(), 1, NULL, GETDATE())
	END CATCH

END
GO
/****** Object:  StoredProcedure [Staging].[Staging-to-FactK12StudentCourseSections]    Script Date: 8/9/2023 3:43:40 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [Staging].[Staging-to-FactK12StudentCourseSections] AS 
BEGIN

	ALTER INDEX ALL ON RDS.FactK12StudentCourseSections DISABLE

	Begin Transaction
 
	INSERT INTO rds.FactK12StudentCourseSections
		(
		  SchoolYearId
		, DataCollectionId
		, SeaId
		, IeuId
		, LeaAccountabilityId
		, LeaAttendanceId
		, LeaFundingId
		, LeaGraduationId
		, LeaIndividualizedEducationProgramId
		, K12SchoolId
		, K12StudentId
		, K12DemographicId
		, K12CourseId
		, K12CourseStatusId
		, ScedCodeId
		, CipCodeId
		, LanguageId
		, EntryGradeLevelId
		, StudentCourseSectionCount
		)
	SELECT 
		  rsy.DimSchoolYearId
		, ISNULL(rddc.DimDataCollectionId, -1) AS DataCollectionId
		, ISNULL(rds.DimSeaId, -1) AS SeaId
		, ISNULL(rdi.DimIeuId, -1) AS IeuId
		, ISNULL(rdlAcc.DimLeaId, -1) AS LeaAccountabilityId
		, ISNULL(rdlAtt.DimLeaId, -1) AS LeaAttendanceId
		, ISNULL(rdlFun.DimLeaId, -1) AS LeaFundingId
		, ISNULL(rdlGrad.DimLeaId, -1) AS LeaGraduationId
		, ISNULL(rdlIep.DimLeaId, -1) AS LeaIndividualizedEducationProgramId
		, ISNULL(rdksch.DimK12SchoolId, -1) AS K12SchoolId
		, ISNULL(rdp.DimPersonId, -1) AS K12StudentId
		, ISNULL(rdkd.DimK12DemographicId, -1) AS K12DemographicId
		, -1 as DimK12CourseId
		, ISNULL(coursestatus.DimK12CourseStatusId,-1) as DimK12CourseStatusId
		, ISNULL(sced.DimScedCodeId,-1) as DimScedCodeId
		, -1 DimCipCodeId
		, -1 DimLanguageId
		, ISNULL(entryGrade.DimGradeLevelId, -1) As EntryGradeLevelId
		, 1 as StudentCourseSectionCount
	FROM Staging.K12Enrollment ske  
	JOIN Staging.K12StudentCourseSection sppse 
		ON ske.StudentIdentifierState = sppse.StudentIdentifierState
		AND ISNULL(ske.LeaIdentifierSeaAccountability, '') = ISNULL(sppse.LeaIdentifierSeaAccountability, '')
		AND ISNULL(ske.LeaIdentifierSeaAttendance, '') = ISNULL(sppse.LeaIdentifierSeaAttendance, '')
		AND ISNULL(ske.LeaIdentifierSeaFunding, '') = ISNULL(sppse.LeaIdentifierSeaFunding, '')
		AND ISNULL(ske.LeaIdentifierSeaGraduation, '') = ISNULL(sppse.LeaIdentifierSeaGraduation, '')
		AND ISNULL(ske.LeaIdentifierSeaIndividualizedEducationProgram, '') = ISNULL(sppse.LeaIdentifierSeaIndividualizedEducationProgram, '')
		AND ISNULL(ske.SchoolIdentifierSea, '') = ISNULL(sppse.SchoolIdentifierSea, '')
		--AND ISNULL(ske.EnrollmentExitDate,'1900-01-01') = ISNULL(sppse.ExitDate,'1900-01-01')
		--AND ske.EnrollmentEntryDate = sppse.EntryDate
		AND ske.DataCollectionName = sppse.DataCollectionName
		AND ske.SchoolYear = sppse.SchoolYear
	JOIN RDS.DimSchoolYears rsy
		ON ske.SchoolYear = rsy.SchoolYear
	LEFT JOIN RDS.DimLeas rdlAcc
		ON ske.LeaIdentifierSeaAccountability = rdlAcc.LeaIdentifierSea
		AND ske.RecordStartDateTime BETWEEN rdlAcc.RecordStartDateTime AND CASE WHEN rdlAcc.RecordEndDateTime IS NULL THEN GETDATE() ELSE rdlAcc.RecordEndDateTime END
	LEFT JOIN RDS.DimLeas rdlAtt
		ON ske.LeaIdentifierSeaAttendance = rdlAtt.LeaIdentifierSea
		AND ske.RecordStartDateTime BETWEEN rdlAtt.RecordStartDateTime AND CASE WHEN rdlAtt.RecordEndDateTime IS NULL THEN GETDATE() ELSE rdlAtt.RecordEndDateTime END
	LEFT JOIN RDS.DimLeas rdlFun
		ON ske.LeaIdentifierSeaFunding = rdlFun.LeaIdentifierSea
		AND ske.RecordStartDateTime BETWEEN rdlFun.RecordStartDateTime AND CASE WHEN rdlFun.RecordEndDateTime IS NULL THEN GETDATE() ELSE rdlFun.RecordEndDateTime END
	LEFT JOIN RDS.DimLeas rdlGrad
		ON ske.LeaIdentifierSeaGraduation = rdlGrad.LeaIdentifierSea
		AND ske.RecordStartDateTime BETWEEN rdlGrad.RecordStartDateTime AND CASE WHEN rdlGrad.RecordEndDateTime IS NULL THEN GETDATE() ELSE rdlGrad.RecordEndDateTime END
	LEFT JOIN RDS.DimLeas rdlIep
		ON ske.LeaIdentifierSeaIndividualizedEducationProgram = rdlIep.LeaIdentifierSea
		AND ske.RecordStartDateTime BETWEEN rdlIep.RecordStartDateTime AND CASE WHEN rdlIep.RecordEndDateTime IS NULL THEN GETDATE() ELSE rdlIep.RecordEndDateTime END
	LEFT JOIN RDS.DimK12Schools rdksch
		ON ske.SchoolIdentifierSea = rdksch.SchoolIdentifierSea
		AND ske.RecordStartDateTime BETWEEN rdksch.RecordStartDateTime AND  CASE WHEN rdksch.RecordEndDateTime IS NULL THEN GETDATE() ELSE rdksch.RecordEndDateTime END
	LEFT JOIN RDS.DimIeus rdi
		ON (ISNULL(rdksch.IeuOrganizationIdentifierSea, '') = rdi.IeuOrganizationIdentifierSea
			OR ISNULL(rdlAcc.IeuOrganizationIdentifierSea, '') = rdi.IeuOrganizationIdentifierSea)
		AND ske.RecordStartDateTime BETWEEN rdi.RecordStartDateTime AND CASE WHEN rdi.RecordEndDateTime IS NULL THEN GETDATE() ELSE rdi.RecordEndDateTime END
	JOIN RDS.DimSeas rds
		ON ske.RecordStartDateTime BETWEEN rds.RecordStartDateTime AND ISNULL(rds.RecordEndDateTime, GETDATE())
	JOIN RDS.DimDataCollections rddc
		ON ske.DataCollectionName = rddc.DataCollectionName 
	LEFT JOIN RDS.DimPeople rdp
		ON ske.StudentIdentifierState = rdp.K12StudentStudentIdentifierState
		AND ske.RecordStartDateTime BETWEEN rdp.RecordStartDateTime AND ISNULL(rdp.RecordEndDateTime, GETDATE())
		AND ISNULL(ske.FirstName, '') = ISNULL(rdp.FirstName, '')
		AND ISNULL(ske.MiddleName, '') = ISNULL(rdp.MiddleName, '')
		AND ISNULL(ske.LastOrSurname, 'MISSING') = ISNULL(rdp.LastOrSurname, 'MISSING')
		AND ISNULL(ske.Birthdate, '1/1/1900') = ISNULL(rdp.BirthDate, '1/1/1900')
	LEFT JOIN RDS.vwDimK12Demographics rdkd
		ON rsy.SchoolYear = rdkd.SchoolYear
		AND ISNULL(ske.Sex, 'MISSING') = ISNULL(rdkd.SexMap, rdkd.SexCode)
	LEFT JOIN RDS.vwDimGradeLevels entryGrade
		ON ske.SchoolYear = entryGrade.SchoolYear
		AND ske.GradeLevel = entryGrade.GradeLevelMap
		AND entryGrade.GradeLevelTypeDescription = 'Entry Grade Level'
	LEFT JOIN RDS.vwDimK12CourseStatuses coursestatus
		ON rsy.SchoolYear = coursestatus.SchoolYear
		AND ISNULL(sppse.CourseLevelCharacteristic, 'MISSING') = ISNULL(coursestatus.CourseLevelCharacteristicMap,coursestatus.CourseLevelCharacteristicCode)
	LEFT JOIN RDS.DimScedCodes sced
		ON ISNULL(sppse.ScedCourseCode,'MISSING') = sced.ScedCourseCode
	
	
	INSERT INTO RDS.BridgeK12StudentCourseSectionRaces
		(
		  [FactK12StudentCourseSectionId]       
		, [RaceId]                          
		)
	SELECT
		  rfksc.FactK12StudentCourseSectionId
		 , ISNULL(rdr.DimRaceId, -1)
	FROM RDS.FactK12StudentCourseSections rfksc
	JOIN RDS.DimSchoolYears rdsy
		ON rfksc.SchoolYearId = rdsy.DimSchoolYearId
	JOIN RDS.DimPeople rdps
		ON rfksc.K12StudentId = rdps.DimPersonId
	JOIN RDS.DimK12Schools rdks
		ON rfksc.K12SchoolId = rdks.DimK12SchoolId
	JOIN RDS.DimLeas rdlsAcc
		ON rfksc.LeaAccountabilityId = rdlsAcc.DimLeaID
	JOIN RDS.DimLeas rdlsAtt
		ON rfksc.LeaAttendanceId = rdlsAtt.DimLeaID
	JOIN RDS.DimLeas rdlsFun
		ON rfksc.LeaFundingId = rdlsFun.DimLeaID
	JOIN RDS.DimLeas rdlsGrad
		ON rfksc.LeaGraduationId = rdlsGrad.DimLeaID
	JOIN RDS.DimDataCollections rddc
		ON rfksc.DataCollectionId = rddc.DimDataCollectionId
	LEFT JOIN Staging.K12PersonRace skpr
		ON rdps.K12StudentStudentIdentifierState = skpr.StudentIdentifierState
		AND CONVERT(VARCHAR(100), rdks.SchoolIdentifierSea) = skpr.SchoolIdentifierSea
		AND CONVERT(VARCHAR(100), rdlsAcc.LeaIdentifierSea) = skpr.LeaIdentifierSeaAccountability
		AND CONVERT(VARCHAR(100), rdlsAtt.LeaIdentifierSea) = skpr.LeaIdentifierSeaAttendance
		AND CONVERT(VARCHAR(100), rdlsFun.LeaIdentifierSea) = skpr.LeaIdentifierSeaFunding
		AND CONVERT(VARCHAR(100), rdlsGrad.LeaIdentifierSea) = skpr.LeaIdentifierSeaGraduation
		AND rddc.DataCollectionName = skpr.DataCollectionName
	LEFT JOIN Staging.K12Enrollment skse
		ON rdps.K12StudentStudentIdentifierState = skse.StudentIdentifierState
		AND rdks.SchoolIdentifierSea = skse.SchoolIdentifierSea
		AND ISNULL(skpr.LeaIdentifierSeaAccountability, '') = ISNULL(skse.LeaIdentifierSeaAccountability, '')
		AND ISNULL(skpr.LeaIdentifierSeaAttendance, '') = ISNULL(skse.LeaIdentifierSeaAttendance, '')
		AND ISNULL(skpr.LeaIdentifierSeaFunding, '') = ISNULL(skse.LeaIdentifierSeaFunding, '')
		AND ISNULL(skpr.LeaIdentifierSeaGraduation, '') = ISNULL(skse.LeaIdentifierSeaGraduation, '')
		AND skse.HispanicLatinoEthnicity = 1
	--AND rdatd.AcademicTermDesignatorMap = skse.AcademicTermDesignator
	--	AND rdsy.SchoolYear = spse.SchoolYear -- Can't join on School Year because it is set to the data collection school year in the RDS
		AND rddc.DataCollectionName = skse.DataCollectionName
	LEFT JOIN RDS.vwDimRaces rdr
		ON skpr.SchoolYear = rdr.SchoolYear
		AND (ISNULL(skpr.RaceType, 'Race and Ethnicity Unknown') = rdr.RaceMap
			OR (ISNULL(skse.HispanicLatinoEthnicity, 0) = 1
				AND rdr.RaceCode = 'HispanicOrLatinoEthnicity'))

	ALTER INDEX ALL ON RDS.FactK12StudentCourseSections REBUILD


Commit Transaction

END
GO
