	DROP TABLE IF EXISTS #vwDimImmigrantStatuses
	SELECT v.* INTO #vwDimImmigrantStatuses FROM RDS.vwDimImmigrantStatuses  v JOIN #SchoolYears t on v.SchoolYear = t.SchoolYear
