/**********************************************************************
Author: AEM Corp
Date:	5/5/2022
Description: Migrates Comprehensive and Targeted Support  from Staging to RDS.FactOrganizationCounts

************************************************************************/
CREATE PROCEDURE [Staging].[Staging-to-FactOrganizationCounts_ComprehensiveAndTargetedSupport]
	@SchoolYear SMALLINT
AS
BEGIN
	 --SET NOCOUNT ON added to prevent extra result sets from
	 --interfering with SELECT statements.
	SET NOCOUNT ON;

	BEGIN TRY
	
		DECLARE 
		@FactTypeId INT,
		@SchoolYearId int

		SELECT @SchoolYearId = DimSchoolYearId 
		FROM RDS.DimSchoolYears
		WHERE SchoolYear = @SchoolYear

		CREATE TABLE #schoolOrganizationTypes (
			K12SchoolOrganizationType				VARCHAR(20)
		)

		INSERT INTO #schoolOrganizationTypes
		SELECT 
			InputCode
		FROM Staging.SourceSystemReferenceData 
		WHERE TableName = 'RefOrganizationType' 
			AND TableFilter = '001156' 
			AND OutputCode = 'K12School'
			AND SchoolYear = @SchoolYear

		SELECT *
		INTO #vwDimComprehensiveAndTargetedSupports
		FROM RDS.vwDimComprehensiveAndTargetedSupports
		WHERE SchoolYear = @SchoolYear

		CREATE CLUSTERED INDEX ix_tempvwDimComprehensiveAndTargetedSupports ON #vwDimComprehensiveAndTargetedSupports (ComprehensiveSupportMap);

		SELECT *
		INTO #vwDimSubgroups
		FROM RDS.vwDimSubgroups
		WHERE SchoolYear = @SchoolYear

		SELECT @FactTypeId = DimFactTypeId 
		FROM rds.DimFactTypes
		WHERE FactTypeCode = 'compsupport'

		DELETE RDS.FactOrganizationCounts
		WHERE SchoolYearId = @SchoolYearId
			AND FactTypeId = @FactTypeId
		
		/*Comprehensive support reasons*/
		INSERT INTO RDS.FactOrganizationCounts (
			SchoolYearId
			,FactTypeId
			,LeaId
			,K12StaffId
			,K12SchoolId
			,K12SchoolStatusId
			,SeaId
			,TitleIStatusId
			,OrganizationCount
			,TitleIParentalInvolveRes
			,TitleIPartAAllocations
			,AuthorizingBodyCharterSchoolAuthorizerId
			,CharterSchoolManagementOrganizationId
			,SecondaryAuthorizingBodyCharterSchoolAuthorizerId
			,CharterSchoolUpdatedManagementOrganizationId
			,SchoolImprovementFunds
			,K12OrganizationStatusId
			,K12SchoolStateStatusId
			,FederalProgramsFundingAllocationType
			,FederalProgramCode
			,FederalProgramsFundingAllocation
			,ComprehensiveAndTargetedSupportId
			,CharterSchoolStatusId
			,SubgroupId
		)
		SELECT 
			[SchoolYearId] = rsy.DimSchoolYearId
			,[FactTypeId] = @FactTypeId
			,[LeaId] = -1
			,[K12StaffId] = -1
			,[K12SchoolId] = ISNULL(rdksch.DimK12SchoolId,-1)
			,[K12SchoolStatusId] = -1
			,[SeaId] = -1
			,[TitleIStatusId] = -1
			,[OrganizationCount] = 1
			,[TitleIParentalInvolveRes] = -1
			,[TitleIPartAAllocations] = -1
			,[AuthorizingBodyCharterSchoolAuthorizerId] = -1
			,[CharterSchoolManagementOrganizationId] = -1
			,[SecondaryAuthorizingBodyCharterSchoolAuthorizerId] = -1
			,[CharterSchoolUpdatedManagementOrganizationId] = -1
			,[SchoolImprovementFunds] = -1
			,[K12OrganizationStatusId] = -1
			,[K12SchoolStateStatusId] = -1
			,[FederalProgramsFundingAllocationType] = -1
			,[FederalProgramCode] = -1
			,[FederalProgramsFundingAllocation] = -1
			,[ComprehensiveAndTargetedSupportId] = ISNULL(vcts.DimComprehensiveAndTargetedSupportId,-1)
			,[CharterSchoolStatusId] = -1
			,[SubgroupId] = -1
		FROM Staging.K12Organization sko
		INNER JOIN RDS.DimSchoolYears rsy
			ON sko.SchoolYear = rsy.SchoolYear
		LEFT JOIN RDS.DimK12Schools rdksch
			ON sko.SchoolIdentifierSea = rdksch.SchoolIdentifierSea
		INNER JOIN Staging.K12SchoolComprehensiveSupportIdentificationType scsupp
			ON sko.SchoolIdentifierSea = scsupp.SchoolIdentifierSea
		INNER JOIN #vwDimComprehensiveAndTargetedSupports vcts
			ON sko.SchoolYear = vcts.SchoolYear
				AND scsupp.ComprehensiveSupport = vcts.ComprehensiveSupportMap
				AND vcts.AdditionalTargetedSupportandImprovementCode = 'MISSING'
				AND vcts.ComprehensiveAndTargetedSupportCode = 'MISSING'
				AND vcts.ComprehensiveSupportImprovementCode = 'MISSING'
				AND vcts.TargetedSupportCode = 'MISSING'
				AND vcts.TargetedSupportImprovementCode = 'MISSING'

		/*Targeted support subgroups*/
		INSERT INTO RDS.FactOrganizationCounts (
			SchoolYearId
			,FactTypeId
			,LeaId
			,K12StaffId
			,K12SchoolId
			,K12SchoolStatusId
			,SeaId
			,TitleIStatusId
			,OrganizationCount
			,TitleIParentalInvolveRes
			,TitleIPartAAllocations
			,AuthorizingBodyCharterSchoolAuthorizerId
			,CharterSchoolManagementOrganizationId
			,SecondaryAuthorizingBodyCharterSchoolAuthorizerId
			,CharterSchoolUpdatedManagementOrganizationId
			,SchoolImprovementFunds
			,K12OrganizationStatusId
			,K12SchoolStateStatusId
			,FederalProgramsFundingAllocationType
			,FederalProgramCode
			,FederalProgramsFundingAllocation
			,ComprehensiveAndTargetedSupportId
			,CharterSchoolStatusId
			,SubgroupId
		)
		SELECT 
			[SchoolYearId] = rsy.DimSchoolYearId
			,[FactTypeId] = @FactTypeId
			,[LeaId] = -1
			,[K12StaffId] = -1
			,[K12SchoolId] = ISNULL(rdksch.DimK12SchoolId,-1)
			,[K12SchoolStatusId] = -1
			,[SeaId] = -1
			,[TitleIStatusId] = -1
			,[OrganizationCount] = 1
			,[TitleIParentalInvolveRes] = -1
			,[TitleIPartAAllocations] = -1
			,[AuthorizingBodyCharterSchoolAuthorizerId] = -1
			,[CharterSchoolManagementOrganizationId] = -1
			,[SecondaryAuthorizingBodyCharterSchoolAuthorizerId] = -1
			,[CharterSchoolUpdatedManagementOrganizationId] = -1
			,[SchoolImprovementFunds] = -1
			,[K12OrganizationStatusId] = -1
			,[K12SchoolStateStatusId] = -1
			,[FederalProgramsFundingAllocationType] = -1
			,[FederalProgramCode] = -1
			,[FederalProgramsFundingAllocation] = -1
			,[ComprehensiveAndTargetedSupportId] = -1
			,[CharterSchoolStatusId] = -1
			,[SubgroupId] = ISNULL(vs.DimSubgroupId,-1)
		FROM Staging.K12Organization sko
		INNER JOIN RDS.DimSchoolYears rsy
			ON sko.SchoolYear = rsy.SchoolYear
		LEFT JOIN RDS.DimK12Schools rdksch
			ON sko.SchoolIdentifierSea = rdksch.SchoolIdentifierSea
		INNER JOIN Staging.K12SchoolTargetedSupportIdentificationType sktsup
			ON sko.SchoolIdentifierSea = sktsup.SchoolIdentifierSea
		INNER JOIN #vwDimSubgroups vs
			ON sko.SchoolYear = vs.SchoolYear
			AND sktsup.Subgroup = vs.SubgroupMap
			
	END TRY
	BEGIN CATCH
		INSERT INTO Staging.ValidationErrors VALUES ('Staging.Staging-to-FactOrganizationCounts_ComprehensiveAndTargetedSupport', 'RDS.FactOrganizationCounts', 'FactOrganziationCounts', 'FactOrganziationCounts', ERROR_MESSAGE(), 1, NULL, GETDATE())
	END CATCH

		
END
GO
/****** Object:  StoredProcedure [Staging].[Staging-To-FactPsStudentAcademicAwards]    Script Date: 8/9/2023 3:43:40 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [Staging].[Staging-To-FactPsStudentAcademicAwards]
AS

	DROP TABLE IF EXISTS #saa
	SELECT 
		  rdpi.DimPsInstitutionId							AS [PsInstitutionId]
		, ISNULL(rdsy.DimSchoolYearId, -1)					AS [SchoolYearId]
		, -1												AS [PsStudentId]            
		, -1												AS [PsDemographicId] 
		, ISNULL(rdaat.DimPsAcademicAwardTitleId, -1)		AS [PsAcademicAwardTitleId] 
		, ISNULL(awardDate.DimDateId, -1)					AS [AcademicAwardDateId]    
		, ISNULL(rdaas.DimPsAcademicAwardStatusId, -1)		AS [PsAcademicAwardStatusId]
		, spsar.StudentIdentifierState						AS [PsStudentIdentifierState]
		, spsar.InstitutionIpedsUnitId						AS [InstitutionIpedsUnitId]
		, spsar.AcademicAwardTitle							AS [AcademicAwardTitle]
		, AwardDate.DateValue								AS [AcademicAwardDate]
		, spsar.EntryDate									AS [EntryDate]
		, spsar.ExitDate									AS [ExitDate]
	INTO #saa
	FROM Staging.PsStudentAcademicAward spsar
	LEFT JOIN RDS.DimPsInstitutions rdpi
		ON spsar.[InstitutionIpedsUnitId] = rdpi.IPEDSIdentifier
		AND spsar.EntryDate BETWEEN rdpi.RecordStartDateTime AND ISNULL(rdpi.RecordEndDateTime, GETDATE())
	LEFT JOIN RDS.DimPsAcademicAwardTitles rdaat
		ON spsar.AcademicAwardTitle = rdaat.AcademicAwardTitle
	LEFT JOIN RDS.vwDimPsAcademicAwardStatuses rdaas
		ON ISNULL(spsar.[PescAwardLevelType], 'MISSING') = ISNULL(rdaas.PescAwardLevelTypeMap, rdaas.PescAwardLevelTypeCode) 
		AND ISNULL(spsar.[ProfessionalOrTechnicalCredentialConferred], 'MISSING') = ISNULL(rdaas.ProfessionalOrTechnicalCredentialConferredMap, rdaas.ProfessionalOrTechnicalCredentialConferredCode)
		AND spsar.SchoolYear = rdaas.SchoolYear
	LEFT JOIN RDS.DimSchoolYears rdsy
		ON spsar.SchoolYear = rdsy.SchoolYear
	JOIN RDS.DimDates awardDate
		ON spsar.AcademicAwardDate = awardDate.DateValue

	DROP TABLE IF EXISTS #spse
	-- Students who exited school during or right before they received an award
	SELECT 
		  s.PsStudentIdentifierState
		, s.InstitutionIpedsUnitId
		, spse.Id						AS [StagingPsStudentEnrollmentId]
		, s.AcademicAwardDate
	INTO #spse
	FROM #saa s
	LEFT JOIN Staging.PsStudentEnrollment spse
		ON s.PsStudentIdentifierState = spse.StudentIdentifierState
		AND s.InstitutionIpedsUnitId = spse.InstitutionIpedsUnitId
		AND (s.EntryDate = spse.EntryDate
			OR s.AcademicAwardDate BETWEEN spse.EntryDate AND ISNULL(spse.ExitDate, GETDATE()))

	-- Students who received an award before enrolling in the institution
	; WITH cte AS (
		SELECT 
			  s.PsStudentIdentifierState
			, s.InstitutionIpedsUnitId
			, spse.Id						AS [StagingPsStudentEnrollmentId]
			, ROW_NUMBER() OVER (PARTITION BY s.PsStudentIdentifierState, s.InstitutionIpedsUnitId ORDER BY spse.EntryDate ASC) RowNumber
		FROM #spse s
		JOIN Staging.PsStudentEnrollment spse
			ON s.PsStudentIdentifierState = spse.StudentIdentifierState
			AND s.InstitutionIpedsUnitId = spse.InstitutionIpedsUnitId
			AND s.AcademicAwardDate < spse.EntryDate
	)
	UPDATE #spse
	SET StagingPsStudentEnrollmentId = c.StagingPsStudentEnrollmentId
	FROM #spse s
	JOIN cte c
		ON s.PsStudentIdentifierState = c.PsStudentIdentifierState
		AND s.InstitutionIpedsUnitId = c.InstitutionIpedsUnitId
		AND c.RowNumber = 1
	WHERE s.StagingPsStudentEnrollmentId IS NULL

	-- Students who received an award but there isn't an enrollment record, get the last record before their award date
	; WITH cte AS (
		SELECT 
			  s.PsStudentIdentifierState
			, s.InstitutionIpedsUnitId
			, spse.Id						AS [StagingPsStudentEnrollmentId]
			, ROW_NUMBER() OVER (PARTITION BY s.PsStudentIdentifierState, s.InstitutionIpedsUnitId ORDER BY spse.EntryDate DESC) RowNumber
		FROM #spse s
		JOIN Staging.PsStudentEnrollment spse
			ON s.PsStudentIdentifierState = spse.StudentIdentifierState
			AND s.AcademicAwardDate >= spse.EntryDate
		WHERE s.StagingPsStudentEnrollmentId IS NULL
	)
	UPDATE #spse
	SET StagingPsStudentEnrollmentId = c.StagingPsStudentEnrollmentId
	FROM #spse s
	JOIN cte c
		ON s.PsStudentIdentifierState = c.PsStudentIdentifierState
		AND s.InstitutionIpedsUnitId = c.InstitutionIpedsUnitId
		AND c.RowNumber = 1
	WHERE s.StagingPsStudentEnrollmentId IS NULL

	-- Students who received an award but there isn't an enrollment record, get the first record before their award date
	; WITH cte AS (
		SELECT 
			  s.PsStudentIdentifierState
			, s.InstitutionIpedsUnitId
			, spse.Id						AS [StagingPsStudentEnrollmentId]
			, ROW_NUMBER() OVER (PARTITION BY s.PsStudentIdentifierState, s.InstitutionIpedsUnitId ORDER BY spse.EntryDate ASC) RowNumber
		FROM #spse s
		JOIN Staging.PsStudentEnrollment spse
			ON s.PsStudentIdentifierState = spse.StudentIdentifierState
			AND s.AcademicAwardDate <= spse.EntryDate
		WHERE s.StagingPsStudentEnrollmentId IS NULL
	)
	UPDATE #spse
	SET StagingPsStudentEnrollmentId = c.StagingPsStudentEnrollmentId
	FROM #spse s
	JOIN cte c
		ON s.PsStudentIdentifierState = c.PsStudentIdentifierState
		AND s.InstitutionIpedsUnitId = c.InstitutionIpedsUnitId
		AND c.RowNumber = 1
	WHERE s.StagingPsStudentEnrollmentId IS NULL


	-- Create a DimPeople record for anyone that doesn't have one based on what's in Staging.PsStudentEnrollments
	UPDATE #saa
	SET   PsStudentId = rdp.DimPersonId
		, PsDemographicId = rdpd.DimPsDemographicId
	FROM #saa saa
	JOIN #spse s
		ON saa.PsStudentIdentifierState = s.PsStudentIdentifierState
		AND saa.InstitutionIpedsUnitId = s.InstitutionIpedsUnitId
		AND saa.AcademicAwardDate = s.AcademicAwardDate
	JOIN Staging.PsStudentEnrollment spse
		on s.StagingPsStudentEnrollmentId = spse.Id
	JOIN RDS.DimPeople rdp
		ON (spse.Id IS NOT NULL
			AND spse.StudentIdentifierState = rdp.PsStudentIdentifierState 
			AND ISNULL(spse.Birthdate, '01-01-1900') = ISNULL(rdp.Birthdate, '01-01-1900')
			AND spse.EntryDate BETWEEN rdp.RecordStartDateTime AND ISNULL(rdp.RecordEndDateTime, GETDATE())
			)
		OR
			(spse.Id IS NULL
			AND spse.StudentIdentifierState = rdp.PsStudentIdentifierState 
			)
	LEFT JOIN RDS.vwDimPsDemographics rdpd
		ON spse.SchoolYear = rdpd.SchoolYear
		AND ISNULL(spse.[Sex], 'MISSING') = ISNULL(rdpd.SexMap, rdpd.SexCode) 

	-- Get min and max of every institution to find a match for those missing one
	DROP TABLE IF EXISTS #Institutions
	SELECT 
		  MIN(DimPsInstitutionId) AS DimPsInstitutionId
		, IPEDSIdentifier
		, RecordStartDateTime AS RecordStartDateTime
	INTO #Institutions
	FROM RDS.DimPsInstitutions
	GROUP BY IPEDSIdentifier, RecordStartDateTime
	HAVING RecordStartDateTime = MIN(RecordStartDateTime)

	UPDATE #saa
	SET PsInstitutionId = DimPsInstitutionId
	FROM #saa s
	JOIN #Institutions i
		ON s.InstitutionIpedsUnitId = i.IPEDSIdentifier
	WHERE s.PsInstitutionId IS NULL

	INSERT INTO RDS.FactPsStudentAcademicAwards
	SELECT 
		  [SchoolYearId]
		, [PsInstitutionId]             
		, [PsStudentId]    
		, [PsDemographicId]
		, [PsAcademicAwardTitleId]        
		, [AcademicAwardDateId]         
		, [PsAcademicAwardStatusId]       
		, 1                
	FROM #saa

	ALTER INDEX ALL ON RDS.FactPsStudentAcademicAwards REBUILD
GO
/****** Object:  StoredProcedure [Staging].[Staging-to-FactPsStudentAcademicRecord]    Script Date: 8/9/2023 3:43:40 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO

CREATE PROCEDURE [Staging].[Staging-to-FactPsStudentAcademicRecord]
AS

	ALTER INDEX ALL ON RDS.FactPsStudentAcademicRecords DISABLE

	DECLARE @firstDigit smallint = 1, @sql VARCHAR(MAX)

	WHILE @firstDigit < 10
	BEGIN
		
		drop table if exists #Temp
		drop table if exists #MiTemp

		SELECT distinct
			  rsy.DimSchoolYearId								AS SchoolYearId
			, -1												AS SeaId
			, rdpi.DimPsInstitutionId							AS PsInstitutionId
			, rdp.DimPersonId									AS PersonId
			, ISNULL(rdatd.DimAcademicTermDesignatorId, -1)		AS AcademicTermDesignatorId
			, ISNULL(rdpd.DimPsDemographicId,-1)				AS PsDemographicId
			, ISNULL(rdpsis.DimPsInstitutionStatusId, -1)		AS PsInstitutionStatusId
			, ISNULL(rdpes.DimPsEnrollmentStatusId, -1)			AS PsEnrollmentStatusId
			, ISNULL(entryDate.DimDateId, -1)					AS EnrollmentEntryDateId
			, ISNULL(exitDate.DimDateId, -1)					AS EnrollmentExitDate
			, ISNULL(rddc.DimDataCollectionId, -1)				AS DataCollectionId
			, spsar.InstructionalActivityHoursCompletedCredit					AS InstructionalActivityHoursCompletedCredit
			, -1 AS [GradePointAverage]
			, -1 AS [GradePointAverageCumulative]
			, -1 AS [DualCreditDualEnrollmentCreditsAwarded]
			, -1 AS [APCreditsAwarded]
			, -1 AS [CourseTotal]
			,  1 AS [StudentCourseCount]
		Into #Temp
		FROM Staging.PsStudentAcademicRecord spsar
		JOIN Staging.PsStudentEnrollment spse
			ON spsar.InstitutionIpedsUnitId = spse.InstitutionIpedsUnitId
			AND spsar.StudentIdentifierState = spse.StudentIdentifierState
			AND spsar.AcademicTermDesignator = spse.AcademicTermDesignator
			AND spsar.DataCollectionName = spse.DataCollectionName
			AND spsar.SchoolYear = spse.SchoolYear
			AND spsar.EntryDate = spse.EntryDate 
			AND spsar.ExitDate = spse.ExitDate
		JOIN RDS.DimDataCollections rddc
			ON spsar.DataCollectionName = rddc.DataCollectionName
		JOIN RDS.DimSchoolYears rsy
			ON rddc.DataCollectionSchoolYear = cast(rsy.SchoolYear as nvarchar(10))
		JOIN RDS.DimPsInstitutions rdpi
			ON spsar.[InstitutionIpedsUnitId] = rdpi.IPEDSIdentifier
			AND spsar.EntryDate BETWEEN rdpi.RecordStartDateTime AND ISNULL(rdpi.RecordEndDateTime, GETDATE())
		LEFT JOIN RDS.vwDimAcademicTermDesignators rdatd
			ON spsar.AcademicTermDesignator = rdatd.AcademicTermDesignatorMap
			AND spsar.SchoolYear = rdatd.SchoolYear
		LEFT JOIN RDS.vwDimPsEnrollmentStatuses rdpes
			ON spsar.SchoolYear = rdpes.SchoolYear
			AND spse.[PostsecondaryExitOrWithdrawalType] = rdpes.[PostsecondaryExitOrWithdrawalTypeMap]
		LEFT JOIN RDS.DimDates entryDate
			ON spsar.EntryDate = entryDate.DateValue
		LEFT JOIN RDS.DimDates exitDate
			ON spsar.ExitDate = exitDate.DateValue		
		JOIN Staging.PsInstitution spi
			ON spsar.InstitutionIpedsUnitId = spi.InstitutionIpedsUnitId
			AND spsar.SchoolYear = spi.SchoolYear
			AND spsar.DataCollectionName = spi.DataCollectionName
		LEFT JOIN RDS.vwDimPsInstitutionStatuses rdpsis
			ON rdpsis.[LevelOfInstitutionCode] = 'MISSING'
			AND rdpsis.[ControlOfInstitutionCode] = 'MISSING'
			AND rdpsis.[CarnegieBasicClassificationCode] = 'MISSING'
			AND ISNULL(rdpsis.[MostPrevalentLevelOfInstitutionMap], rdpsis.[MostPrevalentLevelOfInstitutionCode]) 
					= ISNULL(spi.MostPrevalentLevelOfInstitutionCode, 'MISSING')
			AND rdpsis.[PredominantCalendarSystemCode] = 'MISSING'
			AND rdpsis.VirtualIndicatorCode = 'MISSING'
			AND rdpsis.SchoolYear = spi.SchoolYear 
	    JOIN RDS.vwDimPsDemographics rdpd
			ON ISNULL(spse.Sex, 'MISSING') = ISNULL(rdpd.SexMap, rdpd.SexCode)
			AND spse.SchoolYear = rdpd.SchoolYear
		LEFT JOIN RDS.DimPeople rdp
			ON spse.StudentIdentifierState = rdp.PsStudentStudentIdentifierState
			AND spse.RecordStartDateTime BETWEEN rdp.RecordStartDateTime AND ISNULL(rdp.RecordEndDateTime, GETDATE())
			AND ISNULL(spse.FirstName, '') = ISNULL(rdp.FirstName, '')
			AND ISNULL(spse.MiddleName, '') = ISNULL(rdp.MiddleName, '')
			AND ISNULL(spse.LastOrSurname, 'MISSING') = ISNULL(rdp.LastOrSurname, 'MISSING')
			AND ISNULL(spse.Birthdate, '1/1/1900') = ISNULL(rdp.BirthDate, '1/1/1900')	
			AND spsar.EntryDate BETWEEN rdp.RecordStartDatetime AND ISNULL(rdp.RecordEndDatetime , GETDATE())
		WHERE spsar.StudentIdentifierState like CAST(@firstDigit AS VARCHAR(1)) + '%'

		CREATE NONCLUSTERED INDEX [IX_temp] ON #Temp 
				(SchoolYearId
				, SeaId
				, PsInstitutionId
				, PersonId
				, AcademicTermDesignatorId
				, PsDemographicId
				, PsInstitutionStatusId
				, PsEnrollmentStatusId
				, EnrollmentEntryDateId
				, EnrollmentExitDate
				, DataCollectionId)

		Insert Into RDS.FactPsStudentAcademicRecords Select * From #Temp 

		SELECT 
			rfpsar.FactPsStudentAcademicRecordId
			, rmdptes.MiDimPsTermEnrollmentStatusesId
		Into #MiTemp
		FROM RDS.FactPsStudentAcademicRecords rfpsar
		JOIN RDS.DimSchoolYears rdsy
			ON rfpsar.SchoolYearId = rdsy.DimSchoolYearId
		JOIN RDS.DimPeople rdps
			ON rfpsar.PsStudentId = rdps.DimPersonId
			AND rdps.PsStudentStudentIdentifierState like CAST(@firstDigit AS VARCHAR(1)) + '%'
		JOIN RDS.DimPsInstitutions rdpi
			ON rfpsar.PsInstitutionId = rdpi.DimPsInstitutionId
		JOIN RDS.vwDimAcademicTermDesignators rdatd
			ON rfpsar.AcademicTermDesignatorId = rdatd.DimAcademicTermDesignatorId
			AND rdatd.SchoolYear = rdsy.SchoolYear
		JOIN RDS.DimDates entryDate
			ON rfpsar.EnrollmentEntryDateId = entryDate.DimDateId
		JOIN RDS.DimDates exitDate
			ON rfpsar.EnrollmentExitDateId = exitDate.DimDateId
		JOIN Staging.MiPsStudentAcademicRecord smpsar
			ON rdps.PsStudentStudentIdentifierState = smpsar.StudentIdentifierState
			AND rdpi.IPEDSIdentifier = smpsar.InstitutionIpedsUnitId
			AND rdatd.AcademicTermDesignatorMap = smpsar.AcademicTermDesignator
			AND entryDate.DateValue = smpsar.EntryDate
			AND exitDate.DateValue = smpsar.ExitDate
		JOIN RDS.MiDimPsTermEnrollmentStatuses rmdptes
			ON ISNULL(CAST(smpsar.RemedialEslSession AS SMALLINT), -1) = rmdptes.RemedialEslSession
			AND ISNULL(CAST(smpsar.RemedialMathSession AS SMALLINT), -1) = rmdptes.RemedialMathSession
			AND ISNULL(CAST(smpsar.RemedialReadingSession AS SMALLINT), -1) = rmdptes.RemedialReadingSession
			AND ISNULL(CAST(smpsar.RemedialScienceSession AS SMALLINT), -1) = rmdptes.RemedialScienceSession
			AND ISNULL(CAST(smpsar.RemedialSession AS SMALLINT), -1) = rmdptes.RemedialSession
			AND ISNULL(CAST(smpsar.RemedialWritingSession AS SMALLINT), -1) = rmdptes.RemedialWritingSession
			AND ISNULL(CAST(smpsar.TransferedMidTermWithoutGrades AS SMALLINT), -1) = rmdptes.TransferedMidTermWithoutGrades
		JOIN #temp temp
			ON temp.PersonId=rfpsar.PsStudentId
			AND temp.SchoolYearId=rfpsar.SchoolYearId
			AND temp.PsInstitutionID=rfpsar.PsInstitutionID
			AND temp.EnrollmentEntryDateId=rfpsar.EnrollmentEntryDateId
			AND temp.EnrollmentExitDate=rfpsar.EnrollmentExitDateId
			AND temp.AcademicTermDesignatorId=rfpsar.AcademicTermDesignatorId
			AND temp.PsDemographicId=rfpsar.PsDemographicId
			AND temp.DataCollectionId=rfpsar.DataCollectionId
			AND temp.PsInstitutionStatusId=rfpsar.PsInstitutionStatusId
		LEFT JOIN RDS.MiFactPsStudentAcademicRecord m
			ON rfpsar.FactPsStudentAcademicRecordId=m.FactPsStudentAcademicRecordId
			AND rmdptes.MiDimPsTermEnrollmentStatusesId=m.MiDimPsTermEnrollmentStatusesId
		WHERE m.FactPsStudentAcademicRecordId IS NULL

		INSERT INTO RDS.MiFactPsStudentAcademicRecord	
		(
			[FactPsStudentAcademicRecordId]  
			, [MiDimPsTermEnrollmentStatusesId]
		)
		SELECT 
			t.FactPsStudentAcademicRecordId,
			t.MiDimPsTermEnrollmentStatusesId
		FROM #MiTemp t 
		
		DBCC SHRINKFILE ('CEDS-Data-Warehouse-V9-2-0-0_log', 1)
		SELECT @Sql = 'USE TempDB
						DBCC FREEPROCCACHE
						DBCC SHRINKFILE (''tempdev'', 1633)
						DBCC SHRINKFILE (''temp2'', 1633)
						DBCC SHRINKFILE (''temp3'', 1633)
						DBCC SHRINKFILE (''temp4'', 1633)
						DBCC SHRINKFILE (''temp5'', 1633)
						DBCC SHRINKFILE (''temp6'', 1633)
						DBCC SHRINKFILE (''temp7'', 1633)
						DBCC SHRINKFILE (''temp8'', 1633)
						DBCC SHRINKFILE (''templog'', 1633)
						USE CEDS'
		exec (@sql)

		PRINT CAST(@firstDigit AS VARCHAR(1))  + '''s Done - FactPsStudentAcademicRecords'
		SET @firstDigit = @firstDigit + 1
	END

	ALTER INDEX ALL ON RDS.FactPsStudentAcademicRecords REBUILD
GO
/****** Object:  StoredProcedure [Staging].[Staging-To-FactPsStudentEnrollments]    Script Date: 8/9/2023 3:43:40 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE  PROCEDURE [Staging].[Staging-To-FactPsStudentEnrollments]
	@DataCollectionName	VARCHAR(60) = NULL
AS
BEGIN
	--ALTER INDEX ALL ON RDS.FactPsStudentEnrollments DISABLE

	INSERT INTO RDS.FactPsStudentEnrollments	
		(
				[SchoolYearId]                 
			, [DataCollectionId]             
			, [EnrollmentEntryDateId]                  
			, [EnrollmentExitDateId]                   
			, [EntryDateIntoPostSecondaryId] 
			, [AcademicTermDesignatorId]     
			, [PsEnrollmentStatusId]         
			, [PsInstitutionStatusId]        
			, [PsInstitutionID]              
			, [PsStudentId]                  
			, [StudentCount]                 
		)
	SELECT DISTINCT
			rsy.DimSchoolYearId
		, ISNULL(rddc.DimDataCollectionId, -1)				AS DimDataCollectionId
		, ISNULL(entryDate.DimDateId, -1)					AS EntryDate
		, ISNULL(exitDate.DimDateId, -1)					AS ExitDate
		, ISNULL(psEntryDate.DimDateId, -1)					AS EntryDateIntoPostSecondaryId
		, ISNULL(rdatd.DimAcademicTermDesignatorId, -1)		AS DimAcademicTermDesignatorId
		, ISNULL(rdpes.DimPsEnrollmentStatusId, -1)			AS DimPsEnrollmentStatusId
		, ISNULL(rdpsis.DimPsInstitutionStatusId, -1)		AS DimPsInstitutionStatusId
		, rdpi.DimPsInstitutionId
		, rdp.DimPersonId
		, 1
	FROM Staging.PsStudentEnrollment spse
	INNER JOIN Staging.PsInstitution spi
		ON spse.InstitutionIpedsUnitId = spi.InstitutionIpedsUnitId
		AND spse.SchoolYear = spi.SchoolYear
		AND spse.DataCollectionName = spi.DataCollectionName
	INNER JOIN RDS.DimDataCollections rddc
		ON spse.DataCollectionName = rddc.DataCollectionName
	INNER JOIN RDS.DimSchoolYears rsy
		ON spse.SchoolYear = rsy.SchoolYear
	INNER JOIN RDS.DimPsInstitutions rdpi
		ON spse.[InstitutionIpedsUnitId] = rdpi.IPEDSIdentifier
		AND spse.EntryDate BETWEEN rdpi.RecordStartDateTime AND ISNULL(rdpi.RecordEndDateTime, GETDATE())
	INNER JOIN Staging.SourceSystemReferenceData sssrd
		ON sssrd.SchoolYear = rsy.SchoolYear
		AND sssrd.TableName = 'RefSex'
		AND spse.Sex = sssrd.InputCode
	LEFT JOIN RDS.DimPeople rdp
		ON spse.StudentIdentifierState = rdp.PsStudentStudentIdentifierState
		AND ISNULL(spse.FirstName, '') = ISNULL(rdp.FirstName, '')
		AND ISNULL(spse.MiddleName, '') = ISNULL(rdp.MiddleName, '')
		AND ISNULL(spse.LastOrSurname, 'MISSING') = ISNULL(rdp.LastOrSurname, 'MISSING')
		AND ISNULL(spse.Birthdate, '1/1/1900') = ISNULL(rdp.BirthDate, '1/1/1900')
		AND spse.EntryDate BETWEEN rdp.RecordStartDatetime AND ISNULL(rdp.RecordEndDatetime , GETDATE())
	LEFT JOIN RDS.vwDimAcademicTermDesignators rdatd
		ON spse.AcademicTermDesignator = rdatd.AcademicTermDesignatorMap
		AND spse.SchoolYear = rdatd.SchoolYear
	LEFT JOIN RDS.vwDimPsInstitutionStatuses rdpsis
		ON rdpsis.[LevelOfInstitutionCode] = 'MISSING'
		AND rdpsis.[ControlOfInstitutionCode] = 'MISSING'
		AND rdpsis.[CarnegieBasicClassificationCode] = 'MISSING'
		AND (rdpsis.[MostPrevalentLevelOfInstitutionMap] = spi.MostPrevalentLevelOfInstitutionCode 
			OR (spi.MostPrevalentLevelOfInstitutionCode IS NULL 
				AND rdpsis.[MostPrevalentLevelOfInstitutionCode] = 'MISSING'))
		AND rdpsis.[PredominantCalendarSystemCode] = 'MISSING'
		AND rdpsis.VirtualIndicatorCode = 'MISSING'
		AND spse.SchoolYear = rdpsis.SchoolYear
	LEFT JOIN RDS.vwDimPsEnrollmentStatuses rdpes
		ON spse.SchoolYear = rdpes.SchoolYear
		AND spse.[PostsecondaryExitOrWithdrawalType] = rdpes.[PostsecondaryExitOrWithdrawalTypeMap]
	LEFT JOIN RDS.DimDates entryDate
		ON spse.EntryDate = entryDate.DateValue
	LEFT JOIN RDS.DimDates exitDate
		ON spse.ExitDate = exitDate.DateValue
	LEFT JOIN RDS.DimDates psEntryDate
		ON spse.EntryDateIntoPostsecondary = psEntryDate.DateValue
	WHERE @DataCollectionName IS NULL 
		OR spse.DataCollectionName = @DataCollectionName
	
	--Only use LEFT joins to junk tables

	INSERT INTO RDS.BridgePsStudentEnrollmentRaces
		(
			[FactPsStudentEnrollmentId]       
			, [RaceId]                          
		)
	SELECT DISTINCT
			rfpse.FactPsStudentEnrollmentId
		, ISNULL(rdr.DimRaceId, -1)
	FROM RDS.FactPsStudentEnrollments rfpse
	INNER JOIN RDS.DimSchoolYears rdsy
		ON rfpse.SchoolYearId = rdsy.DimSchoolYearId
	INNER JOIN RDS.DimPeople rdps
		ON rfpse.PsStudentId = rdps.DimPersonId
	INNER JOIN RDS.DimPsInstitutions rdpi
		ON rfpse.PsInstitutionId = rdpi.DimPsInstitutionId
	INNER JOIN RDS.vwDimAcademicTermDesignators rdatd
		ON rfpse.AcademicTermDesignatorId = rdatd.DimAcademicTermDesignatorId
		AND rdatd.SchoolYear = rdsy.SchoolYear
	INNER JOIN RDS.DimDates entryDate
		ON rfpse.EnrollmentEntryDateId = entryDate.DimDateId
	INNER JOIN RDS.DimDates exitDate
		ON rfpse.EnrollmentExitDateId = exitDate.DimDateId
	INNER JOIN RDS.DimDataCollections rddc
		ON rfpse.DataCollectionId = rddc.DimDataCollectionId
	LEFT JOIN Staging.PsPersonRace sppp
		ON rdps.PsStudentStudentIdentifierState = sppp.StudentIdentifierState
		AND CONVERT(VARCHAR(100), rdpi.IPEDSIdentifier) = sppp.InstitutionIpedsUnitId
		AND rdatd.AcademicTermDesignatorMap = sppp.AcademicTermDesignator
	--	AND rdsy.SchoolYear = sppp.SchoolYear -- Can't join on School Year because it is set to the data collection school year in the RDS
		AND rddc.DataCollectionName = sppp.DataCollectionName
		AND entryDate.DateValue = sppp.RecordStartDateTime
		AND ISNULL(exitDate.DateValue, '1900-01-01') = ISNULL(sppp.RecordEndDateTime, '1900-01-01')
	LEFT JOIN Staging.PsStudentEnrollment spse
		ON rdps.PsStudentStudentIdentifierState = spse.StudentIdentifierState
		AND rdpi.IPEDSIdentifier = spse.InstitutionIpedsUnitId
		AND spse.HispanicLatinoEthnicity = 1
		AND rdatd.AcademicTermDesignatorMap = spse.AcademicTermDesignator
	--	AND rdsy.SchoolYear = spse.SchoolYear -- Can't join on School Year because it is set to the data collection school year in the RDS
		AND rddc.DataCollectionName = spse.DataCollectionName
		AND entryDate.DateValue = spse.EntryDate
		AND ISNULL(exitDate.DateValue, '1900-01-01') = ISNULL(spse.ExitDate, '1900-01-01')
	LEFT JOIN RDS.vwDimRaces rdr
		ON ((ISNULL(sppp.RaceType, 'Race and Ethnicity Unknown') = rdr.RaceMap
				AND sppp.SchoolYear = rdr.SchoolYear)
			OR (ISNULL(spse.HispanicLatinoEthnicity, 0) = 1
				AND rdr.RaceCode = 'HispanicOrLatinoEthnicity'))

	--ALTER INDEX ALL ON RDS.FactPsStudentEnrollments REBUILD

END
GO
/****** Object:  StoredProcedure [Staging].[Staging-To-FactSpecialEducation]    Script Date: 8/9/2023 3:43:40 PM ******/
